import React, { useState } from "react";
import "../styles.css";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";

function Navbar(props) {
  const [isHovered1, setIsHovered1] = useState(false);
  const [isHovered2, setIsHovered2] = useState(false);
  const [isHovered3, setIsHovered3] = useState(false);
  const [isHovered4, setIsHovered4] = useState(false);
  const [isHovered5, setIsHovered5] = useState(false);
  // const [isHovered6, setIsHovered6] = useState(false);

  const handleMouseEnter1 = () => {
    setIsHovered1(true);
  };

  const handleMouseLeave1 = () => {
    setIsHovered1(false);
  };

  const handleMouseEnter2 = () => {
    setIsHovered2(true);
  };

  const handleMouseLeave2 = () => {
    setIsHovered2(false);
  };

  const handleMouseEnter3 = () => {
    setIsHovered3(true);
  };

  const handleMouseLeave3 = () => {
    setIsHovered3(false);
  };

  const handleMouseEnter4 = () => {
    setIsHovered4(true);
  };

  const handleMouseLeave4 = () => {
    setIsHovered4(false);
  };

  const handleMouseEnter5 = () => {
    setIsHovered5(true);
  };

  const handleMouseLeave5 = () => {
    setIsHovered5(false);
  };

  return (
    <>
      <section id="home">
        <nav className="navbar navbar-expand-lg bg-body-tertiary">
          <div className="container">
            <img
              src={process.env.PUBLIC_URL + "/images/logo.png"}
              alt="Logo"
              className="logo"
            />
            <Link className="navbar-brand text-primary" to="#home">
              <div>Hotel</div>
              <div>Haven</div>
            </Link>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarSupportedContent"
              aria-controls="navbarSupportedContent"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarSupportedContent">
              <ul className={props.main_links}>
                <li className="nav-item">
                  <a
                    className="nav-link text-primary d-flex"
                    onMouseEnter={handleMouseEnter1}
                    onMouseLeave={handleMouseLeave1}
                    href="#intro"
                  >
                    <div>
                      <img
                        src={
                          isHovered1
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">Home</div>
                  </a>
                </li>
                <li className="nav-item">
                  <a
                    className="nav-link text-primary d-flex"
                    onMouseEnter={handleMouseEnter2}
                    onMouseLeave={handleMouseLeave2}
                    href="#about"
                  >
                    <div>
                      <img
                        src={
                          isHovered2
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">Room</div>
                  </a>
                </li>
                <li className="nav-item">
                  <a
                    className="nav-link text-primary d-flex"
                    onMouseEnter={handleMouseEnter3}
                    onMouseLeave={handleMouseLeave3}
                    href="#room"
                  >
                    <div>
                      <img
                        src={
                          isHovered3
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">Services</div>
                  </a>
                </li>
                <li className="nav-item">
                  <Link
                    className="nav-link text-primary d-flex"
                    onMouseEnter={handleMouseEnter4}
                    onMouseLeave={handleMouseLeave4}
                    to="/book"
                  >
                    <div>
                      <img
                        src={
                          isHovered4
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">Book</div>
                  </Link>
                </li>
              </ul>
              <ul className="navbar-nav ms-auto">
                <li className="nav-item">
                  <Link
                    className="nav-link login_btn text-white d-flex"
                    onMouseEnter={handleMouseEnter5}
                    onMouseLeave={handleMouseLeave5}
                    to={props.last_link_path}
                  >
                    <div>
                      <img
                        src={
                          isHovered5
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">{props.last_link_name}</div>
                  </Link>
                </li>
              </ul>
            </div>
          </div>
        </nav>
      </section>
    </>
  );
}

Navbar.defaultProps = {
  main_links: "navbar-nav mx-auto",
  last_link_path: "/",
  last_link_name: "Last Link Name",
};

Navbar.PropType = {
  main_links: PropTypes.string,
  last_link_path: PropTypes.string,
  last_link_name: PropTypes.string,
};

export default Navbar;
